import React, { Component } from 'react'

function getStar(value){
    switch(value){
        case 0:
            return "/../../styles/empty.png"
        case 50:
            return "/../../styles/half.png"
        case 100:
            return "../../../styles/full.png"
    }
}
export default class RAting extends Component {
    render() {
        return (
            <div>
                <img src={getStar(50)} alt=""/>
            </div>
        )
    }
}
